import { StatusBar } from 'expo-status-bar';
import { Button, Text, View, FlatList} from 'react-native';
import { styles, stylesHeader, stylesMain} from './Style';
import { getListOfContacts } from './mainF';

export default function App() {
  return (
    <View style={styles.container}>
      <View style={stylesHeader.containerHeader}>
        <View style={stylesHeader.headerNavbarBrand}>
          <Text style={stylesHeader.navbarLogo}>Contact manager</Text>
        </View>
        <View style={stylesHeader.headerNavbarRight}>
          <Button title='111' color='rgba(52, 52, 52, 0)' titleStyle={{fontSize: 20}}></Button>
          <Button title='111' color='rgba(52, 52, 52, 0)'></Button>
          <Button title='111' color='rgba(52, 52, 52, 0)'></Button>
        </View>
      </View>
      <View style={stylesMain.containerMain}>
      <FlatList
        data={getListOfContacts()}
        renderItem={({item}) => <Item title={item.title} />}
        keyExtractor={item => item.id}
      />
      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const DATA = [
  {
    id: 'bd7acbea-c1b1-46c2-aed5-3ad53abb28ba',
    title: 'First Item',
  },
  {
    id: '3ac68afc-c605-48d3-a4f8-fbd91aa97f63',
    title: 'Second Item',
  },
  {
    id: '58694a0f-3da1-471f-bd96-145571e29d72',
    title: 'Third Item',
  },
];

const Item = ({title}) => (
  <View style={styles.item}>
    <Text style={styles.title}>{title}</Text>
  </View>
);
